import React from "react";
import {
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
  } from 'reactstrap';

function Header() {
  return (
    <div>
      <Navbar color="dark">
        <NavbarBrand href="/">DDU Events</NavbarBrand>
          <Nav className="me-auto" navbar>
            <NavItem>
              <NavLink href="/components/">Home</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="/components/">Create </NavLink>
            </NavItem>
          </Nav>
      </Navbar>
    </div>
  );
}

export default Header;
